/*Table structure for table `eventrolemaster` */

DROP TABLE IF EXISTS `eventrolemaster`;

CREATE TABLE `eventrolemaster` (
  `RoleID` int(5) NOT NULL AUTO_INCREMENT,
  `RoleName` varchar(25) CHARACTER SET latin1 DEFAULT NULL,
  PRIMARY KEY (`RoleID`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;

/*Data for the table `eventrolemaster` */

