/*Table structure for table `eventrolepriv` */

DROP TABLE IF EXISTS `eventrolepriv`;

CREATE TABLE `eventrolepriv` (
  `RoleID` int(5) NOT NULL,
  `RolePriv` varchar(25) NOT NULL,
  PRIMARY KEY (`RoleID`,`RolePriv`),
  CONSTRAINT `FK_eventrolepriv` FOREIGN KEY (`RoleID`) REFERENCES `eventrolemaster` (`RoleID`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

