LIMIT 4;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_browse_eventusers` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_browse_eventusers` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_browse_eventusers`(IN pEventID INT(5), IN pUserID INT(5))
BEGIN
SELECT um.UserID, um.FullName, um.UserLogin
	FROM userevent om, usermaster um
	WHERE om.EventID = pEventID
	AND om.UserID = um.UserID
	AND om.EventID IN 
	(
		SELECT EventID 
		FROM userevent ue, userroles ur, rolepriv up 
		WHERE ue.UserID = pUserID
		AND ue.UserID = ur.UserID
		AND ur.RoleID = up.RoleID
		AND up.RolePriv = 'Browse Event Users'
	)
	ORDER BY um.FullName;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_browse_messages` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_browse_messages` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_browse_messages`(IN pEventID INT(5))
BEGIN
	SELECT um.FullName, om.MessageID, om.Message, om.DateTimePosted, (UNIX_TIMESTAMP(sysdate()) - UNIX_TIMESTAMP(om.DateTimePosted)) as sc, om.MessageType
	FROM messages om, usermaster um
	WHERE om.EventID = pEventID
	AND om.UserID = um.UserID
	ORDER BY MessageID Desc
	LIMIT 50;
    END */$$
DELIMITER ;

