/* Procedure structure for procedure `sp_document_delete` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_document_delete` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_document_delete`(IN pDocumentID INT(5), IN pEventID INT(5), IN pUserID INT(5))
BEGIN
	DELETE FROM documentmaster WHERE DocumentID = pDocumentID
	AND EventID IN (
		SELECT EventID
		FROM userevent
		WHERE UserID = pUserID
	);		
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_document_org_size` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_document_org_size` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_document_org_size`(IN pOrganisationID INT(5))
BEGIN
SELECT FORMAT(sum(DocumentSize),0) as FormatTotalSize, sum(DocumentSize) as TotalSize, om.OrganisationName
FROM documentmaster dm, eventmaster em, userevent ue, organisation_users ou, organisation_master om
WHERE dm.EventID = em.EventID
AND em.EventID = ue.EventID
AND ue.UserID = ou.UserID
AND ou.OrganisationID = om.OrganisationID
AND om.OrganisationID = pOrganisationID
GROUP BY om.OrganisationID;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_eventmaster_add` */

