DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_eventmaster_add`(in pEventName VARCHAR(100),
IN pDateTimeStart datetime,
IN pDateTimeEnd datetime,
IN pLocked Char(1),
in pUserID Int(5))
BEGIN
	INSERT INTO eventmaster
	(EventName,DateTimeStart,DateTimeEnd,Locked,UserID,dateTimeCreated)
