DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_event_chart_odo_perc`(IN pEventID INT(5), IN pUserID INT(5))
BEGIN
    DECLARE est INT(5);
	DECLARE act INT(5);
SELECT 
SUM(UNIX_TIMESTAMP(DateTimeReqEnd)-UNIX_TIMESTAMP(DateTimeReqStart)) AS required,
SUM(UNIX_TIMESTAMP(DateTimeActEnd) - UNIX_TIMESTAMP(DateTimeActStart)) AS actual
FROM taskmaster
WHERE EventID = pEventID;
    END */$$
