/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_event_status_update`(IN pEventID INT(5), in pStatus VARCHAR(11), in pUserID INT(5))
BEGIN
UPDATE eventmaster
SET status = pStatus
WHERE EventID = pEventID
AND EventID IN 
	(
		SELECT EventID 
		FROM userevent ue, userroles ur, rolepriv up 
		WHERE ue.UserID = pUserID
		AND ue.UserID = ur.UserID
		AND ur.RoleID = up.RoleID
		AND up.RolePriv = 'Update Event Status'
	);
END */$$
