DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_graph_task_progress`(IN pEventID INT(5),IN pUserID INT(5))
BEGIN
SELECT TaskName as legend, 
(UNIX_TIMESTAMP(DateTimeReqEnd)-UNIX_TIMESTAMP(DateTimeReqStart))/3600 as line1,
(UNIX_TIMESTAMP(DateTimeActEnd) - UNIX_TIMESTAMP(DateTimeReqEnd))/3600 as line2
FROM taskmaster
WHERE EventID = pEventID
AND EventID IN 
	(
		SELECT EventID 
		FROM userevent ue, userroles ur, rolepriv up 
		WHERE ue.UserID = pUserID
		AND ue.UserID = ur.UserID
		AND ur.RoleID = up.RoleID
		AND up.RolePriv = 'Event Charts'
	)
ORDER BY SortOrder;
    END */$$
DELIMITER ;

