/* Procedure structure for procedure `sp_taskmaster_add` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_taskmaster_add` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_taskmaster_add`(
	in pTaskName VARCHAR(50),
	IN pDescription VARCHAR(255),
	IN pEventID INT(5),
	IN pDateTimeReqStart datetime,
	IN pDateTimeReqEnd datetime,	
	in pUserID int(5))
BEGIN
	DECLARE nextSortOrder INT(5);
	
	SELECT max(SortOrder)+1 INTO nextSortOrder FROM taskmaster WHERE EventID= pEventID;
	IF nextSortOrder IS NULL THEN
		SELECT 1 INTO nextSortOrder;
	END IF;
	INSERT INTO taskmaster
	(TaskName,Description,EventID,DateTimeReqStart,DateTimeReqEnd,UserID,SortOrder,DateTimeCreated)
	VALUES (pTaskName,pDescription,pEventID,pDateTimeReqStart,pDateTimeReqEnd,pUserID,nextSortOrder,sysdate());
	SELECT last_insert_id() as TaskID;
END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_taskmaster_add_dependencies` */

